import { StyleSheet, Platform } from 'react-native';

const styles = StyleSheet.create({
  icon:{
    color: '#2069b2',
  },
  textIcon:{
    color: '#2069b2',
    fontSize: 20,
  },
  scanButton: {
    fontSize: 10,
    backgroundColor: '#2069b2',
    textAlign: 'center',
    borderRadius: 6,
    paddingTop: 15,
    paddingBottom: 15,
    marginTop: 30,
    marginLeft: 40,
    marginRight: 40
  },
  scanButtonText: {
    fontSize: 25,
    fontWeight:'bold',
    color: 'white',
    paddingLeft: 10,
    paddingRight: 10,
  },
});

export default styles;
